У директора школы мистера Стимпсона есть один &laquo;пунктик&raquo;. Всю свою жизнь и жизнь своих сотрудников и учеников он сверяет строго по часам. Но когда близится час его славы, отлаженный механизм дает сбой.

Отправившись на престижную учительскую конференцию на другой конец страны, Стимпсон умудряется перепутать поезда. И теперь, чтобы успеть вовремя и произнести самую важную речь в своей жизни, он вынужден принять участие в безумном марафоне по пересеченной местности через всю Англию.

К концу дня Стимпсон, преследуемый полицией, женой, соседями и коллегами по работе, будет объявлен в розыск за угон автомобиля, кражу, похищение и вандализм&#133;
